import React, { useState } from 'react';
import axios from 'axios';

const ResumeScreener = () => {
    const [resume, setResume] = useState('');
    const [feedback, setFeedback] = useState(null);

    const screenResume = async () => {
        const response = await axios.post('http://localhost:5000/resume-screener', {
            resume,
            jobDescription: 'Sample Job Description'
        });
        setFeedback(response.data);
    };

    return (
        <div>
            <h2>Resume Screener</h2>
            <textarea placeholder="Paste your resume here" onChange={(e) => setResume(e.target.value)}></textarea>
            <button onClick={screenResume}>Screen Resume</button>
            {feedback && <pre>{JSON.stringify(feedback, null, 2)}</pre>}
        </div>
    );
};

export default ResumeScreener;
